import React,{Component} from "react";

class Children extends Component {
    constructor(){
        super();
        //this.eventhandler = this.eventhandler.bind(this);
    }
    eventhandler(){
        const styling = {
            backgroundColor:"green",
            color:"black",
            getstyle(){
                styling 
            }
        }
    }
    render(){
      return(
        <div className="div_child" > 
            <div  style={{display:this.props.email?"block":"none"}} onMouseUp={this.eventhandler}>
                Fisrt Name : {this.props.f_name}
            </div>
            <div style={{display:this.props.email?"block":"none"}}>
                Last Name : {this.props.l_name}
            </div>
            <div>
                user_name : {this.props.user_name}
            </div>
            <div style={{display:this.props.email?"block":"none"}}>
                Age : {this.props.age}
            </div>
            <div style={{display:this.props.email?"block":"none"}}>
                email : {this.props.email}
            </div>
        </div>
      )
    }
}

export default Children;
